const users = [
    {
      id: 1,
      name: 'User 1',
      availability: [
        { day: 'Monday', start: '12:00 PM', end: '1:00 PM' },
        { day: 'Wednesday', start: '1:00 PM', end: '2:00 PM' },
      ],
    },
    {
      id: 2,
      name: 'User 2',
      availability: [
        { day: 'Tuesday', start: '12:30 PM', end: '1:30 PM' },
        { day: 'Thursday', start: '12:00 PM', end: '1:00 PM' },
      ],
    },
    // Add more user objects here
  ];

  export default users;
